insert into torneoPeleas (idTorneo, fechaInicio, fechaFinal, reglas) values (1, '12/6/2024', '10/12/2025', 'Las batallas serán de 1 vs 1 o Dobles con un máximo de 6 Pokémon por entrenador. Cada Pokémon puede usar un ataque por turno y no se permiten trampas ni modificaciones. Gana quien derrote a todos los Pokémon del oponente o tenga más HP al final; se asignan puntos: Victoria = 3, Empate = 1, Derrota = 0. Está prohibido hacer trampa o insultar, y los entrenadores avanzan según victorias o desempeño. Opcionalmente se pueden limitar Pokémon legendarios, niveles máximos o ciertos ataques.');
