insert into torneoDistancia (idTorneo, fechaInicio, fechaFinal, reglas, locacionPartida) values (1, '2/24/2024', '9/30/2024', 'Las batallas del TorneoDistancia se realizarán de forma remota, 1 vs 1, con un máximo de 6 Pokémon por entrenador. Cada Pokémon puede usar un solo movimiento por turno y está prohibido usar trampas, hacks o cualquier modificación del juego. Gana quien derrote a todos los Pokémon del oponente o tenga más puntos al finalizar el enfrentamiento; los puntos se asignan así: Victoria = 3, Empate = 1, Derrota = 0. Está prohibido insultar o sabotear a los oponentes, y los entrenadores avanzan según victorias o desempeño acumulado. Opcionalmente se pueden limitar Pokémon legendarios, movimientos prohibidos o definir un nivel máximo para los combates a distancia.', 'Facultad de Arquitectura');
